import React from "react";

const messages = [
    {
        author: "jhon",
        content: ""
    }
];

const Message = ({ author, content }) => {
    return (
      <span className="chat-messages-message">
        <span style={{ fontWeight: "bold " }}>{author}: </span>
        {content}
      </span>
    );
  };

export const Messages = ({ messages }) => {
    return <div className="chat-messages-container">
        messages
    </div>
};
